        import oracle.odi.domain.model.OdiDataStore

        public class LKM_Object_Storage_to_ADWC_Copy_Direct extends ADWCBaseKM {

                private static final String NEW_LINE = System.getProperty("line.separator");
                protected String targetRuntimeAccessName;
                protected String targetTableDDL;

                protected String sourceSchemaName;
                protected String sourceSchema;
                protected String resourceName;
                protected String region;
                protected String tenant;
                protected String namespace;
                protected String sourceLocation;

                protected List<String> formatProperties;
                private String customUnloadFieldSeparator;
                protected String fileFormat;
                protected String fieldSeparator;
                protected String fieldList;

                protected int skipHeaders;
                protected AbstractSyntaxTree uploadQuery;

                public void setBinding(Binding binding) {

                    super.setBinding(binding);

                    Map variables = binding.getVariables();

                    targetRuntimeAccessName = OdiRef.getOdiGeneratedAccessName("TARG_NAME", physicalNode, "A")
                    binding.setVariable("targetRuntimeAccessName", targetRuntimeAccessName);

                    targetTableDDL = getTargetTableDDL()
                    binding.setVariable("targetTableDDL", targetTableDDL);

                    sourceSchemaName = getSourceSchemaName();
                    binding.setVariable("sourceSchemaName", sourceSchemaName);

                    MapPhysicalNode sourceNode = getSourceNode();

                    if (sourceNode.isAPNode() && sourceNode.getLKM().getName().contains("LKM File to Object Storage")) {
                        sourceNode = getSourceNode(sourceNode);
                    }

                    if (sourceNode.isAPNode() && sourceNode.getLKM().getName().contains("LKM SQL to Object Storage")) {
                        customUnloadFieldSeparator = sourceNode.getLKMOptionValue("FIELD_SEPARATOR").getOptionValueString();
                    }
                    binding.setVariable("customUnloadFieldSeparator", customUnloadFieldSeparator);

                    resourceName = getResourceName(sourceNode);
                    binding.setVariable("resourceName", resourceName);

                    formatProperties = getFormatPropsList();
                    binding.setVariable("formatProperties", formatProperties);

                    fileFormat = "";
                    binding.setVariable("fileFormat", fileFormat);

                    fieldSeparator = "";
                    binding.setVariable("fieldSeparator", fieldSeparator);

		            sourceSchema = '<%=odiRef.getSchemaName("' + sourceSchemaName + '", "D")%>';
		            binding.setVariable("sourceSchema", sourceSchema);

		            region = '<%=odiRef.getDataServerPropertyFromLSchema( "Region", "' + sourceSchemaName + '")%>';
		            binding.setVariable("region", region);

		            tenant = '<%=odiRef.getDataServerPropertyFromLSchema( "Tenant Name", "' + sourceSchemaName + '")%>';
		            binding.setVariable("tenant", tenant);

		            namespace = '<%=odiRef.getDataServerPropertyFromLSchema( "Object Storage Namespace", "' + sourceSchemaName + '")%>';
		            binding.setVariable("namespace", namespace);

		            // sourceLocation = "https://objectstorage." + region + ".oraclecloud.com/n/" + tenant + "/b/" + sourceSchema;
		            sourceLocation = "https://objectstorage." + region + ".oraclecloud.com/n/" + namespace + "/b/" + sourceSchema;
		            binding.setVariable("sourceLocation", sourceLocation);

		            skipHeaders = 0;
		            binding.setVariable("skipHeaders", skipHeaders);

		            fieldList = "";
		            binding.setVariable("fieldList", fieldList);

		            if (variables['subtype'] == "INSERT") {
		               if (generatorContext.getInputQuery() != null) {
                            uploadQuery = buildUploadQueryDirect(generatorContext.getInputQuery())
                       }
                    }
                    binding.setVariable("uploadQuery", uploadQuery);
                }

                String getColNames (MapPhysicalNode node, ITechnology techno) {
                   // def columns = node.getLogicalComponent().getBoundObject().getColumns();
                   def columns = node.getNodeAttributes()

                   StringBuilder columnBuilder = new StringBuilder();
                   for (def column : columns) {
                      if (columnBuilder.length() > 0) {
                         columnBuilder.append(", ");
                      }
                      columnBuilder.append(getSQLAccessNameForTechno(column, techno));
                   }
                   return columnBuilder.toString();
                }

                String getColDefsFixed (MapPhysicalNode node, ITechnology techno) {
                   def columns = node.getNodeAttributes()

                   StringBuilder columnBuilder = new StringBuilder();
                   for (def column : columns) {
                      if (columnBuilder.length() > 0) {
                         columnBuilder.append(", ");
                      }
                      columnBuilder.append(getSQLAccessNameForTechno(column, techno) + " CHAR(" + column.getSize() + ")");
                   }
                   return columnBuilder.toString();
                }

                String getTargetTableDDL () {
                    def targetNode = getTargetNode()
                    def targetBoundObject = targetNode.getLogicalComponent().getBoundObject()
                    def targetKeys = targetBoundObject.getKeys()
                    def field_sep = ",\n"
                    def nl = "\n"

                    def targetCols = targetNode.getNodeAttributes()

                    def targetPKCols = []
                    targetKeys.each { if (it.isPK()) { targetPKCols = it.getColumns() } }

                    def ddl = ""
                    targetCols.each {
                      ddl = ddl + it.getSQLAccessName(false,"") + " " + it.getDdlDataType()
                      if (it.isBoundAttribute() && it.getBoundObject().isMandatory()) {
                        ddl = ddl + " NOT NULL"
                      }
                      ddl = ddl + field_sep
                    }
                    def pks = ""
                    targetPKCols.each { pk ->
                      def pkSQLName = ""
                      targetCols.each {
                        if (it.getName() == pk.getName()) {
                          pkSQLName = it.getSQLAccessName(false,"") }
                        }
                      pks = pks + pkSQLName + ","
                    }
                    if (pks != "") {
                      pks =  pks.substring(0, pks.size()-1)
                      ddl = ddl + "PRIMARY KEY(" + pks + ")"
                    } else {
                      ddl =  ddl.substring(0, ddl.size()-2)
                    }
                    return ddl
                }

                MapPhysicalNode getTargetNode() {
                    List<MapPhysicalNode> targetNodes = physicalNode.getDownstreamConnectedNodes() ;
                    if (targetNodes == null || targetNodes.isEmpty()) {
                        throw new RuntimeException("No target node");
                    }
                    MapPhysicalNode targetNode = targetNodes.get(0);
                    return targetNode
                }

                AbstractSyntaxTree INSERT (SqlQuery sqlQuery) {

                    MapPhysicalNode sourceNode = getSourceNode();
                    MapPhysicalNode targetNode = getTargetNode();

                    String targetLocation = physicalNode.getExecutionUnit().getLocation().getLogicalSchema().getName();
                    String targetSchema = '<%=odiRef.getSchemaName("' + targetLocation + '", "D")%>';

                    String targetResourceName = targetNode.getLogicalComponent().getBoundDataStore().getResourceName()
                    String targetDataStore = '<?=odiRef.getObjectShortName("L", "' + targetResourceName + '", "D")?>'

                    String recordSeparator = "newline";
                    String textDelimiter = ""

                    if (customUnloadFieldSeparator != null && !customUnloadFieldSeparator.equals("")) {
                      fileFormat = "D";
                      fieldSeparator = customUnloadFieldSeparator;
                    }

                    if (sourceNode.isAPNode() && sourceNode.getLKM().getName().contains("LKM File to Object Storage")) {
                        sourceNode = getSourceNode(sourceNode);
                    }

                    String delimitedOption = getOptionValue("DELIMITED_FILE_FORMAT");

                    if (!sourceNode.isAPNode() &&
                        (sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("File") ||
                         sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("Oracle Object Storage"))) {

                         OdiDataStore sourceDataStore = (OdiDataStore)sourceNode.getLogicalComponent().getBoundObject();
                         if (fileFormat.equals("")) {
                             if (sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("File")) {
                                fileFormat = sourceDataStore.getFileDescriptor().getFormatString();
                             } else if (sourceNode.getExecutionUnit().getExecutionTechnology().getName().equals("Oracle Object Storage")) {
                                if (sourceDataStore.getTableFormatType() != null) {
                                  String fileStorageFormat = sourceDataStore.getTableFormatType().getName();
                                  if (fileStorageFormat.equals("DELIMITED")) { fileFormat = "D"; }
                                  if (fileStorageFormat.equals("FIXED")) { fileFormat = "F"; }
                                }
                             }
                             if (fileFormat == "D" && delimitedOption == "CSV") {
                               fileFormat = delimitedOption;
                             }
                         }
                         if (sourceDataStore.getFileDescriptor() != null) {
                             skipHeaders = sourceDataStore.getFileDescriptor().getSkipHeadingLines();
                             fieldSeparator = sourceDataStore.getFileDescriptor().getFieldSeparator();
                             recordSeparator = sourceDataStore.getFileDescriptor().getRowSeparator();
                             textDelimiter = sourceDataStore.getFileDescriptor().getTextDelimiter();
                         }
                    }

                    if (fileFormat.equals("")) {
                        if (delimitedOption == "CSV") {
                            fileFormat = "CSV";
                        } else {
                            fileFormat = "D";
                        }
                    }
                    if (fieldSeparator.equals("")) {fieldSeparator = ",";}

                    List<String> resourceList = getResourceList(resourceName);

                    String generateFields = getOptionValue("GENERATE_FIELD_LIST");
                    if (fileFormat.equals("F")) { generateFields = 'true' }

                    if (generateFields == 'true') {
                      if (getOptionValue("OVERWRITE_FIELD_LIST") != "" && getOptionValue("OVERWRITE_FIELD_LIST") != null) {
                        fieldList = getOptionValue("OVERWRITE_FIELD_LIST");
                      } else {
                        if (!sourceNode.isAPNode() && fieldList.equals("")) {
                          if (fileFormat.equals("F")) {
                            fieldList = getColDefsFixed(sourceNode, targetNode.getExecutionUnit().getExecutionTechnology());
                          } else {
                            fieldList = getColNames(sourceNode, targetNode.getExecutionUnit().getExecutionTechnology());
                          }
                        } else if (sourceNode.isAPNode() && sourceNode.getLKM().getName().contains("LKM SQL to Object Storage")) {
                          fieldList = "";
                          uploadQuery.getSelectList().each {
                            fieldList = fieldList + getSQLAccessNameForTechno(it.getRefObject(), getTargetNode().getExecutionUnit().getExecutionTechnology()) + ","
                          }
                          fieldList = fieldList.substring(0, fieldList.length() - 1)
                        }
                      }
                    } else {
                        fieldList = ""
                    }

                    String formatPropertiesPlus = getOptionValue("ADD_FORMAT_PROPERTIES");
                    if (formatPropertiesPlus == null) {formatPropertiesPlus = "";}

                    CopyDataDirectADWC copyDataStatement = new CopyDataDirectADWC(targetDataStore,
                                                                      targetSchema,
                                                                      credName,
                                                                      resourceList,
                                                                      sourceLocation,
                                                                      fileFormat,
                                                                      skipHeaders,
                                                                      fieldSeparator,
                                                                      recordSeparator,
                                                                      textDelimiter,
                                                                      fieldList,
                                                                      formatProperties,
                                                                      formatPropertiesPlus);

                    copyDataStatement.setIsPushFromSource(false);
                    return copyDataStatement;
                }
            }


